import React, { useState } from 'react';
import styled from 'styled-components';
import ImageGallery from './ImageGallery.jsx';
import SearchBar from './SearchBar.jsx';
import ProgressBar from './ProgressBar.jsx';

const CardWrapper = styled.div`
  background: white;
  border-radius: 12px;
  width: 400px;
  height: 700px;
  display: flex;
  flex-direction: column;
  overflow: hidden;
  box-shadow: 0 4px 20px rgba(0, 0, 0, 0.1);
`;

const CardHeader = styled.div`
  padding: 20px;
  border-bottom: 1px solid #f0f0f0;
`;

const CardTitle = styled.h3`
  margin: 0 0 16px 0;
  font-size: 18px;
  font-weight: 600;
  color: #333;
`;

const CardContent = styled.div`
  flex: 1;
  padding: 20px;
  display: flex;
  flex-direction: column;
`;

const ContentText = styled.p`
  font-size: 16px;
  color: #666;
  line-height: 1.6;
  margin: 0 0 24px 0;
  text-align: center;
`;

const GallerySection = styled.div`
  flex: 1;
  margin-bottom: 20px;
`;

const SectionTitle = styled.h4`
  font-size: 14px;
  color: #888;
  margin: 0 0 12px 0;
  font-weight: 500;
`;

const ModalOverlay = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: rgba(0, 0, 0, 0.8);
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 1000;
`;

const Modal = styled.div`
  background: #4a4a4a;
  padding: 30px;
  border-radius: 16px;
  text-align: center;
  color: white;
  max-width: 280px;
`;

const ModalIcon = styled.div`
  width: 60px;
  height: 60px;
  background: #5a9fd4;
  border-radius: 50%;
  margin: 0 auto 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 24px;
`;

const ModalText = styled.div`
  margin-bottom: 20px;

  .main-text {
    font-size: 16px;
    margin-bottom: 8px;
  }

  .sub-text {
    font-size: 14px;
    color: #ccc;
  }
`;

const ModalButtons = styled.div`
  display: flex;
  flex-direction: column;
  gap: 8px;

  button {
    padding: 12px;
    border: none;
    border-radius: 8px;
    font-size: 14px;
    cursor: pointer;

    &.primary {
      background: #5a9fd4;
      color: white;
    }

    &.secondary {
      background: transparent;
      color: #ccc;
      border: 1px solid #666;
    }
  }
`;

const Card = ({ onSearchFocus }) => {
  const [showModal, setShowModal] = useState(false);

  return (
    <>
      <CardWrapper>
        <CardHeader>
          <ProgressBar percentage={60} text="온보딩 60%" />
          <CardTitle>날씨 선택하기</CardTitle>
        </CardHeader>

        <CardContent>
          <ContentText>
            거의 다 왔어요! 영어님이 좋아하는<br />
            날씨를 골라주세요.
          </ContentText>

          <GallerySection>
            <SectionTitle>좋아하는 날씨를 선택해주세요</SectionTitle>
            <ImageGallery />
          </GallerySection>

          <SearchBar onFocus={onSearchFocus} />
        </CardContent>
      </CardWrapper>

      {showModal && (
        <ModalOverlay onClick={() => setShowModal(false)}>
          <Modal onClick={e => e.stopPropagation()}>
            <ModalIcon>📱</ModalIcon>
            <ModalText>
              <div className="main-text">
                기상청의 사진 접근을 허용하시겠습니까?
              </div>
              <div className="sub-text">
                사진 및 동영상 접근
              </div>
            </ModalText>
            <ModalButtons>
              <button className="primary">확인하세요</button>
              <button className="secondary">취소하기</button>
            </ModalButtons>
          </Modal>
        </ModalOverlay>
      )}
    </>
  );
};

export default Card;
